def minWindow(s, t):
    left = 1
    right = 0
    countChar = 0
    countT = len(set(t))
    minWindowLen = float('inf')
    minWindowString = ''
    dictT = {}
    for char in t:
        dictT[char] = dictT.get(char, 0) + 1
    while right < len(s):
        if s[right] in dictT:
            dictT[s[right]] -= 1
            if dictT[s[right]] == 0:
                countChar += 1
        while countChar == countT:
            if right - left + 1 < minWindowLen:
                minWindowLen = right - left + 1
                minWindowString = s[left:right + 1]
            if s[left] in dictT:
                dictT[s[left]] += 1
                if dictT[s[left]] > 0:
                    countChar -= 1
            left += 1
        right += 1
    return minWindowString

